import React from "react";
import { useNavigate } from "react-router-dom";

const ProductCard = ({
  product,
  enabledSelection,
  selected,
  onProductSelected,
  onProductDeselect,
}) => {
  const navigate = useNavigate();
  const selectProductHandler = () => {
    if (enabledSelection) {
      if (selected) {
        onProductDeselect(product);
      } else {
        onProductSelected(product);
      }
    } else {
      navigate(`/products/edit/${product.product_id}`);
    }
  };
  const priceRange = `${product.min_price} EGP - ${product.max_price} EGP`;
  return (
    <div
      onClick={selectProductHandler}
      style={{
        backgroundColor: "lightgrey",
        padding: "20px",
        margin: "10px",
        borderRadius: "10px",
        display: "flex",
        gap: "20px",
        userSelect: selected ? "none" : "auto",
        position: "relative",
      }}
    >
      <div
        style={{
          position: "absolute",
          height: "8px",
          width: "8px",
          borderRadius: "50%",
          backgroundColor: product.is_visible ? "green" : "red",
        }}
      ></div>
      <img
        src="/logo512.png"
        alt="Logo"
        style={{ width: "10rem", height: "10rem" }}
      />
      {/* Content Div --------------------------------------- */}
      <div style={{ width: "100%" }}>
        <div
          style={{
            display: "flex",
            justifyContent: "space-between",
          }}
        >
          <h1>{product.name}</h1>
          {enabledSelection && (
            <input
              type="checkbox"
              checked={selected}
              onChange={() => {}}
              style={{
                width: "20px",
                height: "20px",
                marginRight: "8px",
                cursor: "pointer",
              }}
            />
          )}
        </div>
        <span>
          {" "}
          {product.variants > 0 ? priceRange : `${product.base_price} EGP`}
        </span>
        <div
          style={{
            display: "flex",
            gap: "1rem",
            justifyContent: "space-between",
          }}
        >
          <div>
            <p style={{ marginBottom: 0 }}>Variants</p>
            <h4 style={{ margin: 0 }}>{product.variants}</h4>
          </div>
          <div>
            <p style={{ marginBottom: 0 }}>Availability</p>
            <h4 style={{ margin: 0 }}>{product.availability || 0}</h4>
          </div>
          <div>
            <p style={{ marginBottom: 0 }}>Ordered</p>
            <h4 style={{ margin: 0 }}>{product.orders || 0}</h4>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ProductCard;

import { Button } from "@/components";
import React, { useEffect, useState } from "react";
import { PageLoader } from "@/components";

function ItemsList({
  list = [],
  ListRender,
  EmptyListRender = () => {},
  LoadingListRender = () => <PageLoader />,
  itemKey = "",
  cols = 2,
  SelectionBar,
  selectionCancellationDepends,
  isLoading,
}) {
  const [isSelectEnabled, setIsSelectEnabled] = useState(false);
  const [selectedItems, setSelectedItems] = useState(new Map());
  const [search, setSearch] = useState("");

  const searchFilteredItems =
    list.filter((item) =>
      item.name.toLowerCase().includes(search.toLowerCase())
    ) || [];

  const itemSelectedHandler = (item) => {
    setSelectedItems((prev) => new Map(prev).set(item[itemKey], item));
  };

  const itemDeselectHandler = (item) => {
    setSelectedItems((prev) => {
      const newSet = new Map(prev);
      newSet.delete(item[itemKey]);
      return newSet;
    });
  };

  const handleSelectAllItems = () => {
    setSelectedItems(
      new Map(searchFilteredItems.map((item) => [item[itemKey], item]))
    );
  };

  const handleDeselectAllItems = () => {
    setSelectedItems(new Map());
  };

  const handleCancelSelection = () => {
    setIsSelectEnabled(false);
    handleDeselectAllItems();
  };

  const isAllItemsSelected = searchFilteredItems.every((item) =>
    selectedItems.has(item[itemKey])
  );

  useEffect(() => {
    handleCancelSelection();
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [selectionCancellationDepends]);

  const renderSelectionButtons = () => {
    if (isSelectEnabled) {
      return (
        <Button
          onClick={
            isAllItemsSelected ? handleDeselectAllItems : handleSelectAllItems
          }
        >
          {isAllItemsSelected ? "Deselect All" : "Select All"}
        </Button>
      );
    }

    if (!isSelectEnabled)
      return <Button onClick={() => setIsSelectEnabled(true)}>Select</Button>;
  };

  if (isLoading) {
    return <LoadingListRender />;
  }
  return (
    <>
      <div style={style}>
        <input
          type="search"
          onChange={(e) => setSearch(e.target.value)}
          placeholder="Search"
          style={{
            width: "50%",
            padding: "10px",
            border: "0",
            borderRadius: "20px",
          }}
        />
        <div style={buttonDivStyle}>
          {isSelectEnabled && (
            <Button onClick={handleCancelSelection}>Cancel</Button>
          )}
          {searchFilteredItems.length > 0 && renderSelectionButtons()}
        </div>
      </div>
      <div
        style={{
          display: "grid",
          gridTemplateColumns: `repeat(${cols}, minmax(0, 1fr))`,
          gap: "0.5rem",
        }}
      >
        {searchFilteredItems.length > 0
          ? searchFilteredItems.map((item) =>
              ListRender({
                item,
                selected: selectedItems.has(item[itemKey]),
                enabledSelection: isSelectEnabled,
                onSelect: itemSelectedHandler,
                onDeselect: itemDeselectHandler,
              })
            )
          : EmptyListRender()}
      </div>
      {isSelectEnabled &&
        SelectionBar({ selectedItems, onCancel: handleCancelSelection })}
    </>
  );
}

export default ItemsList;

const style = {
  display: "flex",
  flexDirection: "row",
  justifyContent: "space-between",
  alignItems: "center",
  marginTop: "8px",
  width: "100%",
};
const buttonDivStyle = {
  display: "flex",
  flexDirection: "row",
  gap: "10px",
};




//Usage
<ItemsList
      list={products?.data}
      itemKey="product_id"
      ListRender={(props) => (
        <ProductCard
          {...props}
          product={props.item}
          onProductSelected={props.onSelect}
          onProductDeselect={props.onDeselect}
          selected={props.selected}
        />
      )}
      isLoading={isProductsLoading}
      LoadingListRender={() => <p>loading..</p>}
      selectionCancellationDepends={collectionId}
      EmptyListRender={() => <p>No products in this collection</p>}
      SelectionBar={(props) => (
        <ProductsActions
          selectedProducts={props.selectedItems}
          collectionsList={collectionsList}
          onActionSuccess={props.onCancel}
        />
      )}
    />

#include <iostream>
using namespace std;

void processMatrix(double matrix[][100], int N) {
    double totalPositiveSum = 0;
    int positiveCount = 0;

    // Найти среднее арифметическое положительных элементов
    for (int i = 0; i < N; i++) {
        for (int j = 0; j < N; j++) {
            if (matrix[i][j] > 0) {
                totalPositiveSum += matrix[i][j];
                positiveCount++;
            }
        }
    }

    double averagePositive = (positiveCount > 0) ? totalPositiveSum / positiveCount : 0;
    cout << "Среднее арифметическое положительных элементов: " << averagePositive << endl;

    // Преобразовать массив
    for (int j = 0; j < N; j++) {
        double rowPositiveSum = 0;
        for (int i = 0; i < N; i++) {
            if (matrix[i][j] > 0) {
                rowPositiveSum += matrix[i][j];
            }
        }

        if (rowPositiveSum > 0) {
            for (int i = 0; i < N; i++) {
                matrix[i][j] /= rowPositiveSum;
            }
        }
    }
}

int main() {
    int N;
    cout << "Введите размер матриц (N): ";
    cin >> N;

    if (N > 100) {
        cout << "Размер матрицы превышает допустимое значение (100)." << endl;
        return 1;
    }

    double matrix1[100][100] = {0};
    double matrix2[100][100] = {0};
    double matrix3[100][100] = {0};

    double* matrices[3] = {(double*)matrix1, (double*)matrix2, (double*)matrix3};

    for (int k = 0; k < 3; k++) {
        cout << "Введите элементы матрицы " << k + 1 << " (" << N << "x" << N << "):" << endl;
        for (int i = 0; i < N; i++) {
            for (int j = 0; j < N; j++) {
                cin >> matrices[k][i * N + j];
            }
        }

        processMatrix((double(*)[100])matrices[k], N);

        cout << "Преобразованная матрица " << k + 1 << ":" << endl;
        for (int i = 0; i < N; i++) {
            for (int j = 0; j < N; j++) {
                cout << matrices[k][i * N + j] << " ";
            }
            cout << endl;
        }
    }

    return 0;
}

Future<RefillSync> syncRefill(
      {@required String? kodeCustomer,
      @required String? noJadwal,
      @required String? noRealisasi,
      @required int? finishRefill,
      @required bool? syncInventory}) async {
    SharedPreferences prefs = await SharedPreferences.getInstance();
    String? kodeUser = prefs.getString('kodeUser');
    String? token = prefs.getString('token');

    RefillSync response = RefillSync();

    try {
      int offset = 0;
      int limit = 50;

      var dbClient = await db;

      String getAllDetailQuery =
          'SELECT * FROM $detailRealisasiTable WHERE $dNoRealisasi = \'$noRealisasi\'';
      var getAllDetail = await dbClient!.rawQuery(getAllDetailQuery);

      // round up
      int loopTimes = (getAllDetail.length / limit).ceil() == 0
          ? 1
          : (getAllDetail.length / limit).ceil();
      print('SYNC REFILL CALLED - LOOPTIMES $loopTimes');

      var syncRefill;
      for (var i = 0; i < loopTimes; i++) {
        String getDetailQuery = '';
        print('OFFSET => $offset');
        if (syncInventory!) {
          getDetailQuery =
              'SELECT * FROM $detailRealisasiTable WHERE $dNoRealisasi = \'$noRealisasi\' AND $dLock = \'0\' LIMIT $limit OFFSET $offset';
        } else {
          getDetailQuery =
              'SELECT * FROM $detailRealisasiTable WHERE $dNoRealisasi = \'$noRealisasi\' AND $dConnectionMode = \'offline\' LIMIT $limit OFFSET $offset';
        }

        var detailGet = await dbClient.rawQuery(getDetailQuery);
        print('detailGet.length => ${detailGet.length}');

        List<Map> refillMap = [];
        if (detailGet.length > 0) {
          for (var j = 0; j < detailGet.length; j++) {
            refillMap.add({
              'barcode': detailGet[j][dBarcode],
              'type': detailGet[j][dType],
              'brand': detailGet[j][dBrand],
              'media': detailGet[j][dMedia],
              'kapasitas': detailGet[j][dKapasitas],
              'kadaluarsa': detailGet[j][dKadaluarsa],
              'keterangan': detailGet[j][dKeterangan]
            });
          }
        }

        Map refillData = {'data': refillMap};

        var getDir = await getExternalStorageDirectory();
        var path = '${getDir!.path}/Refill';

        String jsonString = jsonEncode(refillData);
        print('jsonString => $jsonString');
        print('path => $path');
        var jsonPath =
            await createJson(jsonString, path, 'Refill $noRealisasi $i');

        var dio = Dio();

        FormData formData = FormData.fromMap({
          'kode_user': kodeUser,
          'token': token,
          'kode_customer': kodeCustomer,
          'no_jadwal': noJadwal,
          'finish_refill': finishRefill,
          'sync_inventory': syncInventory ? 1 : 0,
          "data": MultipartFile.fromBytes(File(jsonPath).readAsBytesSync(),
              filename: '${kodeCustomer!}_${DateTime.now()}'),
        });

        syncRefill = await dio.post(Modal.refillSyncExtinguisherV2,
            data: formData, onSendProgress: (send, rec) {
          print('send : $send / receive : $rec');
        }).timeout(Modal.timeout);

        print('syncRefill.msg => $syncRefill');
        RefillSync decodeSyncRefill = RefillSync();
        if (syncRefill != null) {
          decodeSyncRefill = RefillSync.fromJson(syncRefill.data);
        }

        if (decodeSyncRefill.msgCode == 200 && detailGet.isNotEmpty) {
          print('update status to online');
          print('detailGet[i][dBarcode => $detailGet');

          // only update header and detail status if only data sync success
          if (finishRefill == 1) {
            String updateHeaderQuery =
                'UPDATE $headerRealisasiTable SET $hStatus = 1, $hTglSelesai = \'${DateTime.now()}\' WHERE $hNoRealisasi = \'$noRealisasi\'';
            await dbClient.rawQuery(updateHeaderQuery);
          }

          String headerRefillQuery =
              'SELECT * FROM $headerRealisasiTable WHERE $hNoRealisasi = \'$noRealisasi\'';
          var headerRefill = await dbClient.rawQuery(headerRefillQuery);
          if (headerRefill.isNotEmpty) {
            if (headerRefill[0][hConnectionMode] == 'offline' &&
                    headerRefill[0][noJadwal] == '' ||
                headerRefill[0][hConnectionMode] == 'offline' &&
                    headerRefill[0][noJadwal] == null) {
              String updateHeaderRefillQuery =
                  'UPDATE $headerRealisasiTable SET $hConnectionMode = \'online\', $hNoJadwal = \'$noJadwal\' WHERE $hNoRealisasi = \'$noRealisasi\'';
              await dbClient.rawQuery(updateHeaderRefillQuery);
            }
          }

          if (detailGet.length > 0) {
            for (var k = 0; k < detailGet.length; k++) {
              var updateStatusQuery =
                  'UPDATE $detailRealisasiTable SET $dConnectionMode = \'online\' WHERE $dBarcode = \'${detailGet[k][dBarcode]}\' AND $dNoRealisasi = \'$noRealisasi\'';
              await dbClient.rawQuery(updateStatusQuery);
            }
          }
        }

        offset += limit;
      }

      if (syncRefill != null) {
        response = RefillSync.fromJson(syncRefill.data);
      }
    } catch (e) {
      print('syncRefill ERR => $e');
    }

    return response;
  }

#include <iostream>
#include <cmath> // Для использования sqrt
using namespace std;

int main() {
    double A, B, C;
    cout << "Введите значения A, B и C: ";
    cin >> A >> B >> C;

    // Вычисление числителя
    double numerator = A * A + B * B + C * C;

    // Вычисление знаменателя
    double denominator = sqrt(1 + 2 * A + B - 2 * C);

    // Проверка, что знаменатель не равен нулю
    if (denominator == 0) {
        cout << "Знаменатель равен нулю, деление невозможно." << endl;
        return 1;
    }

    // Вычисление S
    double S = numerator / denominator;

    cout << "Значение S: " << S << endl;

    return 0;
}
